import React from 'react';
import Hero from './components/Hero/Hero'
import { Container , Row, Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.scss';

const App = () => {
  return (
    <Container>
      <Row>
        <Col sm={12} md={6}>
          <Hero></Hero>
        </Col>
      </Row>
    </Container>
  );
}
export default App;
